import React from "react";
import { useState, useEffect } from "react";

export default function News() {
  const [post, setPost] = useState([]);

  useEffect(() => {
    fetch(
      "https://newsapi.org/v2/everything?q=medical&from=2022-05-09&sortBy=publishedAt&apiKey=14ca7051b89b45fca6adf6fc35da4824"
    ).then((response) =>
      response.json().then((data) => setPost(data.articles))
    );
  }, []);

  post.forEach((article) => {
    console.log(article.content);
  });
  return (
    <div className="bg-gray-700   h-auto  mt-[100px] max-w-[1400px] mx-auto">
      <div className="flex gap-2">
        <div className="top-list w-1/2 sticky h-[400px] bg-white">
          <h1 className="text-3xl text-gray-400 underline">NEWS</h1>
        </div>
        <div className="news-list">
          <h1 className="text-3xl text-gray-400 underline">NEWS</h1>

          <div className="">
            {post.map((post) => (
              <div className="w-[900px]  p-4 bg-gray-100 mt-10 flex flex-col gap-4">
                <h1 className="text-2xl">{post.title}</h1>
                <img
                  className="mt-2 max-h-[400px]"
                  src={post.urlToImage}
                  alt=""
                />
                <p>{post.content}</p>{" "}
                <a
                  className="underline text-righttext-blue-600"
                  href={post.url}
                >
                  View more..
                </a>
                <p className="text-right">{post.publishedAt}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}
